import './App.css';
import Navbar from './Components/Navbar/Navbar';
import {Browse, Routes, Route} from 'React-router-dom';

function App() {
  return (
    <div>
      <BrowserRoute>
      <Navbar/>
      <Routes>
        <Route path = '/' element={<Cart/>} />

      </Routes>
      </BrowserRoute>
    </div>
  );
}

export default App;
